@ifvictr > can we have some sort of enforcement of which messages get sent where? it's kinda hard to follow/find things i'm interested in when everything's being sent everywhere
@ifvictr  
@ifvictr  it would be great to find a way to suggest a correct channel for any message, but otherwise it should be natural IMO

> Then maybe an invite only wiki or something? Like maybe even charge a subscription fee (like how people have Patreon tiers)? I'm just thinking that telling people to "lurk moar" isn't a scalable way to grant access to our knowledge. It just makes the same questions repeat again and again in chat.
@pm_41 
I personally think a subscription fee might not be that great of an idea, because a lot of genz are students and even if they aren't a lot of them don't have a lot of spare money. Maybe we could have some kind of donation system. For example that people donate to get ranks by donating, but to still keep ot accesible for everybody regardless of their socio-economic situation.

> By sub fee I meant something like $2/month. It’s a soft standard that a lot of YouTube channels use for their fan discords.
@pm_41 
Well yes. Kinda what I was getting to was especially for young people in third world countries 2 USD is still not that easy to get. Even though this might be quite rare I still feel like we can't just avoid those people and take their chance to socialize with others that might have the same view on things like political problems, LGBTQ+, tech stuff, etc. I live in Paraguay, which is quite a homophobic country and I feel like if some of the people in the LGBTQ+ community can find others that think the same way they do it might be quite a blessing for them. And I can talk from experience that it is not easy to find people that are ok with LGBTQ+ in a society that is so scared of this. But that's just my opinion and I'd be happy to hear other people's view on the subject
